import styled from 'styled-components';

export const Landing = styled.div`
width: 100vw;
height: 100vh;
background: linear-gradient(to left, #000, #333);
& button{
    background: transparent;
    border: none;
    & img{
        width: 10rem;
        &:hover{
            filter: brightness(.7);
        }
        &:{
            filter: brightness(.4);
        }
    }
}
`
